#include <fstream>
#include <map>
#include <cmath>
using namespace std;
 
int powpow (string s){
    int n=0;
    for (int i=s.size()-1; i>=0; i--){
        if (s.substr(i,1)=="1") n+=pow(2,(s.size()-i-1));
    }
    return n;
}
 
int main() {
    ifstream fin("chaincode.in");
    ofstream fout("chaincode.out");
    int n;
    fin >> n;
    map<string,int> code;
    string str;
    for (int i=0; i<n; i++) str+='0';
    code[str]=0;
    fout << str << "\n";
    for (int i=1; i<pow(2,n); i++){
        str=str.substr(1,n-1)+'1';
        int r=powpow(str);
        if (code.find(str)==code.end()) code[str]=r;
        else {
            str=str.substr(0,n-1)+'0';
            code[str]=r-1;
        }
        fout << str << "\n";
    }
    fin.close();
    fout.close();
}
